import React from 'react'
import Navbar from './Nav/Navbar';
import './Home.css';
import {useTranslation} from "react-i18next";


function Home() {
    const {t, i18n} = useTranslation('common');

    return (
        
        <div className="home">
            <Navbar t={t}/>
        </div>
        
    )
}

export default Home
